//import { get } from "mongoose";
import React, { useEffect, useState, useRef } from "react";
import axios from 'axios'
//import { useNavigate } from "react-router-dom";
import './Profilepage.css'
//import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
//import LoadingBar from 'react-top-loading-bar'

const auth = localStorage.getItem('loginData');

function AddProduct() {
    const [admin, setAdmin] = useState(false);

    useEffect(() => {
        submit();
    }, [])
    let submit = async () => {
        try {
            const response = await axios.post("http://localhost:8080/userFind", {
                auth
            })
            console.log("first")
            setAdmin(response.data.admin)
        } catch (error) {
            console.log(error);
        }
    };
    return (
        <>
            <div className="container">
                <form class="">
                    <div class="mb-3 row">
                    <div class="col">
                        <label class="form-label" for="formGridEmail">Email</label>
                        <input placeholder="Enter email" type="email" id="formGridEmail" class="form-control"/>
                    </div>
                    <div class="col">
                        <label class="form-label" for="formGridPassword">Password</label>
                        <input placeholder="Password" type="password" id="formGridPassword" class="form-control"/>
                    </div>
                </div>
                <div class="mb-3">
                    <label class="form-label" for="formGridAddress1">Address</label>
                    <input placeholder="1234 Main St" id="formGridAddress1" class="form-control"/>
                </div>
                <div class="mb-3">
                    <label class="form-label" for="formGridAddress2">Address 2</label>
                    <input placeholder="Apartment, studio, or floor" id="formGridAddress2" class="form-control"/>
                </div>
                <div class="mb-3 row">
                    <div class="col">
                        <label class="form-label" for="formGridCity">City</label>
                        <input id="formGridCity" class="form-control"/>
                    </div>
                    <div class="col">
                        <label class="form-label" for="formGridState">State</label>
                        <select class="form-select" id="formGridState">
                            <option selected="">Choose...</option>
                            <option>...</option>
                        </select>
                    </div>
                    <div class="col">
                        <label class="form-label" for="formGridZip">Zip</label>
                        <input id="formGridZip" class="form-control"/>
                    </div>
                </div>
                <div class="mb-3" id="formGridCheckbox">
                    <div class="form-check">
                        <input type="checkbox" class="form-check-input"/>
                        <label title="" class="form-check-label">Check me out</label>
                    </div>
                </div>
                <button type="submit" class="btn btn-primary">Submit</button>
            </form>
            </div>
        </>
    )
}

export default AddProduct
